import React from "react";

const Userinput = props => (

    <form onSubmit={props.get_data} style={{ marginBottom:"2rem" }}>

        Enter your Preferred language: <span>  </span>
        <input className="form__input" type="text" name="skill" placeholder="Enter language" required />
        <span>  </span>
        <b className="form__input" type="submit" value="Submit" />

    </form>
);

export default Userinput;
